      "abstract": "This exhibition examines the nature of art practice in Kingston, Ontario through the interrelationships of 18 of its artists. The curator asked nine local artists to select one work by an artist of their choice for the exhibition, and those artists who were chosen, in turn, selected one work by their nominator. In brief statements, the artists reveal the reasons for their choices. 3 bibl. ref. Biographical notes. List of works.",
