      "collation": "271 p. : 74 ill. (33 en coul) ; 28 x 20 cm",
      "abstract": "Catalogue of an exhibition correlating 19 Canadian artworks with texts by a dozen authors, in accordance with the 18th-century pictorial genre known as the “conversation piece.” Déry looks at exhibition practices in Quebec and abroad in light of her curatorial experience, while Sirois reflects on speech, perception and the exhibition as a fictional space. Prioul, for his part, explores the future of the museum, in the process recommending a practice grounded in research and the transmission of knowledge. Texts in English and French. List of works; plan of the gallery space. Biographical notes on the artists, authors and other contributors.",
