      "abstract": "This book documents the work produced and exhibited by the artists-in-residence at the Wimbledon School of Art’s Drawing Centre during the 2001-2002 session: Heath, Gunning, and Smith. Short essays address each artist’s work, and the artists speak about their work in individual interviews. Ginsborg states that this project’s purpose is to give an account of the diversity of their practices, taking liberties with what counts as drawing in order to expand its possibilities. Biographical notes. 22 bibl. ref.",
