      "abstract": "In this catalogue for an exhibition that surveys Sterbak’s photography, Nemiroff concludes that the most predominant feature are the photographs that demonstrate the use or the fortune of the artist’s sculptural objects. Far from conferring on them a secondary status, Nemiroff argues that the photographs make clear the importance of performance in Sterbak’s art and contribute to situating her objects in a broader reality. Includes a brief artist statement and excerpts of texts by W.H. Auden and J. Saramango. List of works. 8 bibl. ref.",
