      "collation": "68 p. : 54 ill. (9 en coul.) ; 23 x 19 cm",
      "abstract": "This publication documents the first of four exhibitions in which an artist is invited to create a project based on photographs from the CCA’s collection. In an interview with Von Amelunxen, Paiement sets out the themes common to both the photographs he selected and his photomontage, “Fractal Palace”: the construction of images and buildings; narration; transparency. With reference to painting, Paiement details how his works explore two conceptions of space — namely, as centred and panoramic. Texts in English and French. Biographical notes on the artist and author. List of works. 4 bibl. ref.",
