      "collation": "34 p. : 20 ill. coul. ; 14 x 27 cm",
      "abstract": "Curator Boucher traces the evolution of Coutu’s work since 1997, the year he produced a photographic self-portrait which the author considers definitive of his artistic approach, and which was followed by a shift to sculptural installations. Emphasizing the aerospace connotations of Coutu’s work, the author focuses on two installations, one of which, ‘‘La Moderne,’’ was recently acquired by the Musée du Québec. Texts in French and English. Bio-bibliography. 5 bibl. ref.",
