      "resume": "La conservatrice Boucher évoque le parcours artistique de Coutu depuis 1997, date où il réalise un autoportrait photographique qu’elle considère fondateur de sa démarche (qui s’oriente depuis vers l’installation sculpturale). Soulignant les connotations aérospatiales du travail de Coutu, l’auteure analyse en particulier deux œuvres installatives, dont une intitulée « La Moderne », acquise récemment par le Musée du Québec. Textes en français et en anglais. Biobibliographie. 5 réf. bibl.",
