      "collation": "124 p. : 57 ill. (19 en coul.) ; 28 x 23 cm",
      "abstract": "Arguing for an ethical reconsideration of subjectivity, Deutsche posits a complex relationship between Welling and the other, less abstract, artists who critically re-evaluated photography in the 1980s. Like those artists, Welling’s investigation of photography, so Deutsche claims, questions mastery and testifies to the vulnerability of photography’s subject matter. Text in English, French and Dutch. List of works. Brief biographical notes. 27 bibl. ref.",
