      "eprint_status": "archive",
      "physical_copy": "TRUE",
      "resume": "Dans son texte critique qui revendique une révision éthique de la subjectivité, Deutsche établit une relation complexe entre Welling et d’autres artistes qui, dans les années 1980 et par le biais d’œuvres moins abstraites que celle de Welling, ont réévalué la photographie selon une perspective critique. Deutsche suggère que, à l’instar de ces artistes, les explorations photographiques de Welling remettent en cause la notion de maîtrise du médium au profit de la vulnérabilité du sujet. Texte en anglais, en français et en néerlandais. Inclus une liste des œuvres et de brèves notices biographiques. 27 réf. bibl.",
