      "abstract": "Mahon’s exhibitions “Tunnel of Love” and “The Palace at 4 A.M.” at Museum London and “GIFTwrap” at the Art Gallery of Hamilton are discussed. Metcalfe addresses the artist’s engagement with architectures of storage, exhibition, and exchange, referring particularly to the museum in capitalist society. Kellman elucidates the merging of the visual and the verbal in the work. Madill comments on Mahon’s transgression of modernist aesthetics, which interrogates methods of presenting art to the public. List of works. Biographical notes on the authors. Bio-bibliography 2 p.; 2 bibl. ref.",
