      "abstract": "Jeffries claims Ruwedel provides a symptomatology of the earth and a syntax of earth-shaping in his photos. Decrying the vandalism of the American desert’s archaeological records, Lopez, who is sensitive to the environment and its history, narrates his encounter with a horse intaglio (a subject of Ruwedel’s photos). Thomas addresses the whole of Ruwedel’s complex oeuvre, which inventories the marks left on the land by the passage of geological time and human history. 55 bibl. ref. Biographical notes.",
