      "abstract": "Catalogue for an exhibition that demonstrates how the sexuality of gay males is portrayed in current art via the works of twenty four artists from a wide range of disciplines. Murray’s essay addresses both « gay art » classification, which he qualifies as a catachresis, and representation and self-representation of the gay male body, which he breaks down into four categories : the masked body, the performed body, the suffering body, and the exhibited body. Texts in French and English. Biographical notes. List of works. 17 bibl. ref.",
