      "resume": "Catalogue d’une exposition dont l’objectif est de démontrer comment la sexualité des hommes gays se concrétise dans l’art actuel, et ce, à travers les œuvres de 24 artistes de diverses disciplines. Le conservateur Murray élabore une réflexion sur la classification « art gay », qu’il qualifie de catachrèse, et sur la représentation et l’autoreprésentation du corps masculin gay, décliné pour l’occasion en quatre catégories : le corps masqué, le corps performé, la souffrance du corps et le corps exhibé. Textes en français et en anglais. Notices biographiques. Liste des oeuvres. 17 réf. bibl.",
