      "abstract": "This catalogue surveys Paiement’s career and production from 1983 to 2002. In her essay, curator Ninacs refers to Perec, Dürer and Kepler to demonstrate how, in his photographs, the artist uses devices borrowed from cartography and archaeology to convey his will to “locate himself”. The author discusses how the motif and notion of dwelling occur in his work and how the all-encompassing perspective reveals, in one image, multiple levels of space and time. Text in French and English. List of works. Bio-bibliography 7 p.; circa 30 bibl. ref.",
