      "resume": "Survol de la carrière et des projets réalisés par Paiement de 1983 à 2002. Évoquant notamment Perec, Dürer et Kepler, la conservatrice Ninacs souligne comment l’artiste, par l’utilisation de procédés qui empruntent à la cartographie et à l’archéologie, témoigne dans ses constructions photographiques d’une volonté de « se situer ». L’auteure élabore sur le motif et la notion d’habitation dans les œuvres, et note la façon dont les perspectives englobantes de Paiement dévoilent, dans une seule image, de multiples plans spatio-temporels. Texte en français et en anglais ; liste des œuvres. Biobibliographie 7 p. ; circa 30 réf. bibl.",
