      "abstract": "Curator Scott situates Lum’s art (mainly photography) on the Canadian and international scenes, while tracing his evolution from his beginnings, in the 1970s, to the present. Derksen establishes a direct link between Lum’s work and globalization, considering the artist as an observer of the urban territory, where the consequences of this phenomenon are most apparent. The author underlines how the artist reinterprets the notion of “home” – which no longer refers simply to nation and place – in his images of “urban facts”. List of works; texts in English and French. Biographical notes. 25 bibl. ref.",
