      "abstract": "This exhibition catalogue establishes a dialogue between works by five artists and a text by Beckett entitled “The Lost Ones.” Author Thériault discusses each piece in the context of the artists’ respective practices and how they relate to the text and its dominant theme: perception. Includes a summary of Beckett’s text and information about its theatrical version produced by the Mabou Mines company. Texts in French and English. List of works. Biographical notes.",
