      "resume": "Cet ouvrage majeur sur l’œuvre gravé de Goodwin suit le développement du travail de l’artiste des années 1950 aux années 1990, tant au niveau technique que thématique. Examinant sa production selon trois périodes, les auteurs évoquent le parcours personnel de Goodwin, relèvent ses influences et analysent les œuvres en regard du contexte artistique de l’époque. Maheux signe un essai sur les méthodes et les matériaux utilisés par l’artiste, accompagné d’un glossaire de la gravure. Inclut un catalogue raisonné de 187 œuvres et une liste de planches sans épreuves connues. Chronologie des expositions de l’artiste (10 p.) ; bibliographie (4 p.) ; liste des œuvres de l’exposition. 31 réf. bibl.",
