      "abstract": "Published to accompany an exhibition entitled “Archaeology of the Mind,” this document profiles the practice of architects Herzog and De Meuron, whose work shows a marked interest in the visual arts. Numerous illustrations and photographs of sketches and maquettes accompany texts by more than 20 authors (researchers, architects, artists). The texts are grouped under six chapters corresponding with notions that are central to the duo’s production (transformation and alienation, appropriation and modification, stacking and compression, etc.) Includes many interviews with the two architects as well as a catalogue of works from 1978 to 2002. Biographical notes on artists and collaborators. Bibliography 5 p., 119 bibl. ref.",
