      "abstract": "The archive is examined as facility and metaphor in this publication documenting the exhibition-project “Interarchiv” organised by Obrist and Feldmann in co-operation with the Kunstraum der Universität Lüneburg. In the book’s three sections, the first documents the exhibition and its organisation, the second contains reflections on the archive from different disciplinary perspectives, and the third presents 63 instances of contemporary archiving practices in the field of art. Texts in German and English, with three in French and German. Biographical notes. Circa 500 bibl. ref.",
