      "collation": "36 p. : 18 ill. (11 col.) ; 21 x 21 cm",
      "abstract": "The exhibition provides a forum for three levels of photographic interpretation of the Okanagan Valley: snapshots submitted by residents, the work of four commissioned artists, and juried images taken by local photographers. The artists relate the decision-making that went into their submissions, and the residents briefly describe their photos. Armstrong relates her personal history in the Okanagan, and Thomson and Mackenzie, respectively, describe the past and imagine the future of the Valley. Biographical notes. 2 bibl. ref.",
