      "abstract": "This catalogue was produced for an exhibition that investigated the porous boundaries between mediums when considering sculpture, photography and architecture “as painting.” The 26 artists in the show are considered in detailed commentaries on their work, and two extended essays. Related issues are addressed by other commentators in 14 additional texts/interviews. List of works. Biographical notes. Circa 190 bibl. ref.",
