      "abstract": "Curator Barber describes the socio-cultural context within which the Nova Scotia School of Art and Design (NSCAD) became, in the 1960s and 1970s, one of the pre-eminent art schools in the world, mainly due to its connections with some key figures of the Conceptual Art movement. Artists, instructors and others involved with the college provide personal comments on the spirit of the times and describe the projects and events that defined the school, such as the Lithography Workshop and the NSCAD Press, the Project Class and the Mezzanine exhibition space. List of works, including videotapes. 22 bibl. ref.",
