      "collation": "77, [69] p. ; 68 ill. (50 col.) ; 24 x 21 cm",
      "abstract": "Designed to evoke the shape of the artist’s photographic constructions, this catalogue accompanies an exhibition that underlines Boogaerts’ donation of his entire body of work to the Canadian Museum of Contemporary Photography. Curator Dessureault provides an in-depth survey of Boogaerts’ work from 1972 to 1990, including detailed analyses of his main photographic series. Denée approaches Boogaerts’ practice in terms of its relevance to myth. Includes a list of works with quotes by Boogaerts, as well as an entire section with illustrations of the works. List of the artist’s main exhibitions, 4 p. ; bio-bibliography 8 p.",
