      "resume": "Adoptant une forme qui évoque les constructions photographiques de l’artiste, ce catalogue d’exposition fait suite au don par Boogaerts de son œuvre complet au Musée canadien de la photographie contemporaine. Dessureault examine en détail l’évolution du travail de Boogaerts de 1972 à 1990 et analyse ses principales séries photographiques, alors que Denée considère la pratique de l’artiste selon son rapport au mythe. Inclut une liste des œuvres accompagnée de citations de Boogaerts, ainsi qu’un cahier entièrement constitué de reproductions des œuvres. Liste des principales expositions de l’artiste, 4 p. ; bibliographie, 8 p.",
