      "abstract": "This two volume catalogue for the 49th Venice Biennale, the major theme of which is represented by the phrase “Plateau of Humankind,” features the work of artists from 64 countries and texts by more than 175 authors. The first volume includes a curatorial essay by Szeemann, and documentation of selected works. The second volume focuses on the work of artists who were chosen to represent the countries participating in the biennial. List of works. List of illustrations. Bio-bibliography 159 p. 19 bibl. ref.",
