      "collation": "[64] p. : 28 ill. ; 23 x 16 cm",
      "abstract": "According to Fischer, this exhibition revisits the self-representations of artists in the decade following 1965 because of their relevance to the “return of the body” in more recent art. The author describes the ways that gender, sexuality and subjectivity were negotiated and performed by both men and women artists of that time, revealing a continuity with the present. She notably distinguishes the limiting conditions in the men’s work, which appear self-inflicted, from those in the women’s work, which appear as external oppressive structures. List of works. 20 bibl. ref.",
