      "collation": "127 p. : 60 ill. (10 en coul.) ; 20 x 28 cm",
      "abstract": "This catalogue documents a solo exhibition of Iranian-born artist Neshat, whose work focuses mainly on men and women’s social roles in Islamic society. Curator Gagnon provides an in-depth analysis of the artist’s videos in terms of form and content. Egoyan comments on the piece entitled “Turbulent” and describes how Neshat’s work has inspired him in his own practice as a filmmaker. Neshat’s collaborator Azari elaborates on how the artist’s creative process is linked to her personal life and identifies recurring themes including identity, diaspora, relationships between man and woman, and eastern and western cultures. Texts in French and English ; list of works. Bio-bibliography, 6 p. ; 17 bibl. ref.",
