      "abstract": "This catalogue documents a group exhibition of artworks combining sound and photography, curated by artist R. Gervais for Dazibao’s “Carte grise” series. Gervais’ essay provides an historical context for pieces by C. Marclay, R. Racine, M. Snow and R.M. Tremblay. His analysis of the relationship between photography and phonography since the 1830s focuses on the following subjects: the use of mechanical musical instruments; artists’ experimentation with sound in the 1920s; and R. Opalka’s painting/audio works. Text in French and English. Biographical notes on the curator and artists. 19 bibl. ref.",
