      "resume": "Dans le cadre de la série «Carte grise», l’artiste et commissaire invité Gervais propose une exposition de travaux alliant le son et la photographie. Son essai présente le contexte historique et discute des rapports de la photographie à la phonographie depuis les années 1830, des instruments musicaux mécaniques, de l’expérimentation des années 20, pour ensuite commenter la production des exposants (quatre Canadiens et un Américain) et conclure sur le disque d’artiste du peintre R. Opalka. Texte en français et en anglais. Notices biographiques du commissaire et des artistes. 19 réf. bibl.",
