      "abstract": "This exhibition catalogue features Haraldsson’s photo series of Le Corbusier’s architecture in Firminy, France. Haraldsson’s notes in journal form describe his visit to the site. Steiner argues that the artist deploys the genre of architectural photography in order to unsettle its foundations, the egoism of the architect, and elicit empathy for the project by highlighting and maintaining its incomplete status. List of works. Bio-bibliography 3 p.; 20 bibl. ref.",
