      "resume": "Catalogue d’une exposition qui présentait les expérimentations photographiques sous-marines de Lawrence, réalisées à l’aide d’un appareil à sténopé étanche et d’un kayak-chambre noire, également exposés. Évoquant les implications liées à l’utilisation d’un tel dispositif (dont l’imprévisibilité des résultats), McCormick examine les œuvres selon leur rapport aux explorations romantiques du 19e siècle, qu’elles soient géographiques, scientifiques ou littéraires. Suit un entretien (en anglais seulement) de C. Corry, S. G. Garvey et K. Ruet avec l’artiste, où ce dernier s’exprime sur ses motivations et sa méthode de travail. Liste des œuvres ; notices biographiques de l’artiste et de McCormick. 7 réf. bibl.",
