      "abstract": "This catalogue documents six exhibitions organized in the summer of 2001 to celebrate the 20th anniversary of the Brittany FRAC. The curators of six institutions affiliated with the FRAC elaborate on the development of their collection through themes that best represent them (space, landscape, history…). President of FRAC P. Le Treut states how the Brittany region, which holds collections including works by nearly 140 artists, is open to current art produced elsewhere while sharing its specific heritage. List of works. Texts in French with English translation booklet. 17 bibl. ref.",
