      "abstract": "Catalogue published to accompany a series of three exhibitions that presented artworks from private collections in Vancouver, focusing, as their titles imply, on three areas: work by the Group of Seven (“The Group of Seven”); photography (“Sun Pictures to Photoconceptualism: Photography from Local Collections”); modern and contemporary art (Between Passion and Logic: Contemporary and Modern Art”). The authors/curators’ texts deal mostly with historical aspects of the works, contextualizing them within the evolution of practices and techniques, and also incorporate interviews with collectors and art dealers. Includes a brief section on the Millenial Acquisitions project, which aimed at attracting donations for the Vancouver Art Gallery’s permanent collection. Complete list of works (27 p.) 7 bibl. ref.",
