      "abstract": "This catalogue reviews the 2000-2001 season at the Art Gallery of Bishop’s University, which presented five exhibitions, predominantly “in situ” projects. Six authors examine the artists’ works in detail, namely: a phosphorescent installation by P. Bruneau; N. Bleck’s and A. Nelson-Moody’s photographs on the Squamish people; the video productions of 22 artists and 11 students (examined notably through the notion of voice); N. London’s multidisciplinary work dealing with food in art; the work of the “attitudes d’artistes” duo, whose flags formulate a critique of social representation. Texts in French or English with abstracts in the other language. Biographical notes on artists and authors; lists of illustrations.",
