      "resume": "Bilan des cinq expositions présentées lors de la saison 2000-2001 de la Galerie d’art de l’Université Bishop’s, saison qui mettait l’accent sur des projets in situ. Six auteurs examinent les œuvres en détail, soit : l’installation phosphorescente de P. Bruneau ; les photographies de N. Bleck et A. Nelson-Moody sur le peuple squamish ; les productions vidéographiques de 22 artistes et 11 étudiants (abordées notamment sous l’angle de la voix) ; l’œuvre multidisciplinaire de London sur la problématique des aliments dans l’art ; les drapeaux du duo « attitudes d’artistes » qui proposent une critique de la représentation sociale. Textes en français ou en anglais avec résumés dans l’autre langue. Notices biographiques des artistes et des auteurs. Listes des illustrations.",
