      "abstract": unescape('Catalogue%20for%20a%20retrospective%20exhibition%20of%20Gagnon%27s%20work%20since%20the%201950s%2e%20The%20three%20authors%20maintain%20the%20importance%20of%20Gagnon%2019s%20innovations%20to%20the%20development%20of%20visual%20arts%20in%20Quebec%2c%20stressing%20the%20diversity%2c%20yet%20coherence%2c%20of%20the%20artist%20%2019s%20production%2e%20Godmer%20reviews%20the%20ensemble%20of%20works%20in%20an%20analytic%2fbiographical%20text%3b%20Asselin%20discusses%20themes%20of%20natural%20landscape%2c%20the%20urban%20environment%20and%20the%20use%20of%20text%3b%20while%20Goyette%20concentrates%20on%20Gagnon%2019s%20little%2dknown%20film%20work%20from%201966%2d1970%2e%20Their%20analyses%20reveal%20certain%20recurrent%20characteristics%3a%20the%20dynamic%20potential%20of%20fragmentation%3b%20the%20window%20and%20sky%20motifs%3b%20the%20use%20of%20codes%3b%20movement%20and%20exuberance%3b%20the%20spectator%2019s%20active%20role%2e%20List%20of%20works%2e%20Texts%20in%20French%20and%20English%2e%20Biographical%20information%2020%20p%2e%20Circa%2040%20bibl%2e%20ref%2e'),
