      "resume": "Catalogue de la première rétrospective complète de l’activité artistique de Gagnon depuis les années 50, présentée comme innovatrice et essentielle au développement des arts visuels au Québec. Voulant montrer la multiplicité de son champ (des médiums en particulier) et sa cohérence, trois auteurs abordent l’œuvre soit dans son ensemble (Godmer) dans un texte mi-analytique, mi-biographique, soit en y ciblant les thèmes du paysage naturel, du milieu urbain et de la présence textuelle (Asselin). Goyette examine pour sa part un volet presque inédit de l’œuvre, soit la production cinématographique de Gagnon entre 1966 et 1970. Il ressort de ces analyses les caractéristiques suivantes: le recours au fragment et à son pouvoir dynamisant; la récurrence de motifs (fenêtre, vitrine, ciel) et l’utilisation de codes; la mouvance et l’exubérance; le rôle actif réservé au spectateur. Liste des œuvres. Texte en français et en anglais. Dossier biographique 20 p. Circa 40 réf. bibl.",
