      "collation": "96 p. : 63 ill. ; 30 x 19 cm",
      "abstract": "This publication documents Charney’s work as Canada’s representative for the 7th Venice Biennale International Architecture Exhibition. Chevrier explains the practice of the artist who, since 1970 and in the context of an investigation of “monumentality in the media age,” has collected newspaper articles and photographs of urban architecture and experiences. The author situates the project as a junction of the history of the criticism of architecture and the critique of urbanism. Charney’s text describes his Dictionnaire comprised of 232 plates, which he has organized into nine categories (Events, The structure of events, The structure of structures, Meta-events, Fragmentation, Exclusion and effacement, Reclamation, Affirmation, Out on the edge) according to “what they expose about the interaction between people and the constructed world.” Regimbald discusses various site-specific works produced in parallel with this project since 1974, and suggests an interpretation of Charney’s art as a double process of destruction of the “aura” and the production of “traces.” Texts in English, French and Italian. Biographical notes. Bibliography 1 p.",
