      "resume": "Publication portant sur l’intervention de Charney qui représentait le Canada lors de la 7e Exposition internationale d’architecture de la Biennale de Venise. Chevrier explique la démarche de l’artiste qui, depuis 1970, dans le cadre d’une réflexion sur «la monumentalité au temps des médias», a collectionné des articles d’actualité montrant des bâtiments et des villes. L’auteur situe l’entreprise aux confluents de l’histoire de la critique architecturale et de l’urbanisme critique. Charney décrit son Dictionnaire, composé de 232 planches classées en neuf thèmes: Événements, Structure des événements, Structure des structures, Méta-événements, Fragmentation, Exclusion et effacement, Revendication, Affirmation et En marge. Regimbald commente diverses «insertions urbaines» ou œuvres in situ créées parallèlement par l’artiste depuis 1974 et propose d’interpréter l’art de Charney comme un double processus de destruction de l’«aura» et de fabrication d’«empreintes». Textes en anglais, en français et en italien. Notice biographique. Bibliographie 1 p.",
