      "abstract": "This publication concerns four exhibitions sharing the theme of “the spirit of the times,” presented over a two-year period at Optica and involving ten artists from eastern Canada. Working within the context of the end of the millenium, curator Dion’s text elucidates the idea of “fin de siècle,” outlining the origins and influences surrounding the project and commenting on the aesthetic components of each exhibition organized around themes of the self, language and order, technology, and the relationship to community. Includes S. McKay’s apocalyptic fictional text and transcripts from correspondence between Dion and L. Jacob (from 1999-2000) concerning the 4th exhibition. Curator’s essay in French and English; other texts in English only. List of works. Brief biographical notes. 10 bibl. ref.",
