      "resume": "Publication qui rend compte de quatre expositions unifiées par le même thème (l’esprit du temps), présentées durant une période de deux ans chez Optica et réunissant les pratiques de dix artistes de l’est du Canada. Dion débrouille, en cette fin de millénaire, la complexité de la notion de «fin de siècle» pour mieux situer les composantes esthétiques du projet dans son ensemble, puis à travers les singularités thématiques de chaque exposition: l’idée de soi, le langage et l’ordre, la technologie et le rapport à une communauté. Suivent une fiction apocalyptique par S. McKay et une correspondance entre Dion et L. Jacob à propos du 4e projet d’exposition. Texte du commissaire en français et en anglais; autres textes en version anglaise seulement. Liste des œuvres. Courtes notices biographiques. 10 réf. bibl.",
