      "abstract": "Interviewed by P. Cousineau-Levine on the reasons for his selections, painter and invited curator Dorion presents three artists (two photographers and a painter) engaged with the urban landscape, whose works show affinities with his own practice. He discusses E. Baldus’ notion of erasure, G. Pellerin’s use of the monochrome and R. Collyer’s digital alterations, interspersed with examples of his own figurative experimentation. Texts in French and English. Brief biographical notes.",
