      "abstract": "This catalogue was made to accompany an exhibition of photo-based sculptures by Hong Kong-born artist and physician E. Fong. Lau’s analysis of the artist’s work – aluminium constructions that combine X-ray film, human bones and fluorescent lighting – focuses on themes of bodily fragmentation and the mind/body dichotomy. Lau suggests the pieces offer a critical restaging of Donald Judd’s minimalist sculptures, and describes the effects of their multiple configurations. Angelucci’s interview with the artist also addresses the mind/body split and bodily fragmentation. List of illustrations. List of works. Brief biographical notes. 2 bibl. ref.",
