      "abstract": "Marchand situates Martin’s exhibition at the Musée d’art contemporain de Montréal within the context of the artist’s production since 1982 (consisting primarily of pieces that combine and/or alternate writing and photography). Marchand draws attention to the new work’s specificity (its sculptural dimension) and highlights the interwoven themes: art, love and death. Martin’s lyrical text describes “photo I will never take” – three stories of a young man on a beach in the Pacific; security guard for an exhibit of torture instruments in Italy; a man who rebuffs the narrator’s attempt at intimacy. The catalogue design formally refers to the photographic tondi in the exhibition. Texts in French and English. Bio-bibliography 3 p.",
