      "eprint_status": "archive",
      "physical_copy": "TRUE",
      "resume": "Marchand présente l’œuvre de Martin, qui fait alterner et se combiner écriture et photographie, comme c’est le cas dans cette exposition tenue au Musée d’art contemporain de Montréal. Tout en revisitant le parcours de l’artiste depuis 1982, l’auteure montre la spécificité de son récent travail sculptural avec ses thèmes entrelacés: art, amour et mort. Suit un texte de l’artiste à propos d’un jeune homme sur une plage du Pacifique, de la visite d’une exposition d’instruments de torture et de son gardien, puis d’un homme dictant une lettre à sa secrétaire: autant de sujets qui s’expriment ici par l’écriture plutôt que par l’image. La conception graphique du catalogue évoque formellement les tondi photographiques de l’exposition. Textes en français et en anglais. Biobibliographie 3 p.",
