      "resume": "Présenté par l’Échange International d’Artistes Bâle (IAAB) pour marquer la 15e année des échanges d’artistes en ateliers-résidences entre Montréal et Bâle, ce catalogue présente les œuvres vidéo, installatives et photographiques in situ réalisées par dix artistes (cinq québécois et cinq suisses) ayant comme centre d’intérêt le processus de création à l’étranger. Chaque œuvre fait l’objet d’un texte par un auteur différent, tandis que von Wartburg retrace l’histoire de l’association organisatrice et que Pfaff aborde la thématique du projet d’ensemble. Un livret d’accompagnement comprend des photographies des œuvres. Textes en français et en allemand. Brèves notices biographiques. 2 réf. bibl.",
