      "resume": "Publication soulignant la donation au Musée des beaux-arts de Sherbrooke d’œuvres multidisciplinaires réalisées pour la plupart par des artistes québécois depuis 1980. Pressé fait d’abord le portrait du collectionneur Luc Larochelle, puis décrit la collection à travers ses trois volets principaux : l’art contemporain, la photographie et la sculpture africaine. Elle aborde le sujet du collectionnement lui-même au moyen des critères de Yves Michaud. Inclut un poème de L. Dupré et une nouvelle de B. Lévy, le catalogue complet des 726 œuvres de la collection avec mention des 93 exposées, et un extrait d’entretien avec le collectionneur. Brèves notices biographiques des auteurs. 29 réf. bibl.",
