      "abstract": "The curator, Rollig, claims that the theme of “Hers” is not women’s art per se, but rather, a continuing feminist critique of the representation of women in the media. The work of twenty five artists, three of whom are men, is presented along with short essays, artist’s statements, scripts, and CVs. Three other authors situate the videos in essays that deal with their relationship to mass culture, art history, and cinema. Biographical notes. Bibliography 2 p., 46 bibl. ref.",
