      "uri": "http://e-artexte.ca/id/eprint/13745",
      "collation": "[52] p. : 30 ill. coul. ; 24 x 31 cm",
      "abstract": "Published in conjunction with exhibitions in France and Montreal, this book presents work produced by Jolicoeur as invited artist by the Musée-Château D’Annecy and the Annecy Fine Arts School. Saadé describes the premise of the invitation: to produce a record of the city that would go beyond traditional urban documentary photography towards an “intimate temporality and emancipated reality” to better reveal a “subconscious social imaginary.” Déry situates this use of photography as being outside the artist’s usual way of working, discusses the significance of the digitalized reframing and reworking of the photos, and contrasts these images to the tradition of tourist snapshots and the aesthetic conventions of photographic art. Text in French and English. Brief biographical note.",
