      "eprint_status": "archive",
      "physical_copy": "TRUE",
      "resume": "De Jolicoeur, on présente ici des images recadrées par ordinateur qui redéfinissent deux paradigmes: celui de l’art comme affranchissement de la réalité, et celui de l’urbanité en tant que témoignage photographique d’un imaginaire social. C’est ce dont rendent compte Saadé et Déry, l’un en suivant les visées des institutions de la ville d’Annecy, l’autre davantage préoccupée de situer le projet de «prise de photos» en dehors du travail habituel de l’artiste, en opposition à la tradition des clichés touristiques et aux conventions esthétiques de l’art photographique. Texte en français et en anglais. Brève notice biographique. 4 réf. bibl.",
