      "resume": "Cette publication documente les deux volets d’un événement universitaire qui gravite autour de l’hypothèse d’une subjectivité transgressant la question du moi : une exposition qui réunit les œuvres de quatre artistes montréalais, et un colloque intitulé « L’art pourquoi faire? Pourquoi faire de l’art? ». On distingue deux groupes de communications, selon qu’elles abordent l’aspect paradoxal du thème à travers l’attitude artistique, ou bien la possibilité d’enseigner une telle attitude. L’exploration et la conceptualisation caractéristiques du projet s’assortissent de trois présentations et de réflexions sur des thèmes tels que le désenchantement, l’ambiguïté productive, l’inscription langagière et le principe de plaisir, et l’art-action. Inclut une liste des œuvres exposées. Courtes notices biographiques. 35 réf. bibl.",
