      "abstract": "An artist’s residency at the Banff Centre enabled Will to develop a photographic and narrative project from a box of archival photographs acquired at a garage sale. Choosing one set of negatives from the photographic records of Louis Shulman (a Calgary civil servant), who travelled to Japan by ocean liner in 1923, Will weaves a semi-fictional story around the images, reprinted with captions scratched into the negatives by the artist. This artist’s book/exhibition catalogue includes interpretive essays by editor Tousley and curator Townsend, discussing the photographic record in terms of authenticity, interpretation and appropriation. Brief bio-graphical notes on Will. 9 bibl. ref.",
