      "collation": "279 p. : 217 ill. (42 col.) ; 29 x 23 cm",
      "abstract": "This exhibition catalogue, featuring work by over 135 artists, covers three decades of conceptual art and examines it from a global perspective, focusing on the important local differences that gave rise to distinct conceptual art practices in various regions around the world. The book, like the exhibition, is sectioned by region, and the curator responsible for each region provides an essay which situates the work. Chronology by region (17 p.) Biographical notes. Index (3 p.), list of works (5 p.) and bibliography (5 p.) Circa 230 bibl. ref.",
