      "resume": "Présentation du très court parcours de vie du photographe montréalais décédé en 1991 et de son œuvre restée en grande partie inédite. Les commissaires Campeau et Carrière y commentent des projets (sériels pour la plupart) réalisés entre 1983 et 1990; des amis ou collègues rendent aussi hommage à l’homme estimé et à l’œuvre qui leur est demeurée secrète. Comprend un poème inédit de J.-P. Desaulniers sur l’aptitude de Pelletier à saisir la réalité, ainsi que des propos d’auteurs sur la fonction des objets et de l’écriture. Notice biographique. 3 réf. bibl.",
