      "resume": "Ce document montre qu’en vertu d’une commune mentalité faite d’exaltation et de rêverie sur l’infini – aussi bien que d’incertitude face à l’inconnu, de nostalgie et d’autodérision –, les traditions esthétiques (du romantisme aux dernières avant-gardes) établissent une constante corrélation avec les conquêtes techniques dues aux explorateurs et aux scientifiques. Quatorze auteurs développent la thématique générale sur la découverte du cosmos selon plusieurs axes: le rapport entre créations artistiques et sciences naturelles, l’Amérique terre promise, les régions polaires, la photographie lunaire, l’imaginaire des cosmologies, les visions antithétiques des artistes contemporains – tout en faisant ressortir l’esprit de trois artistes-savants : Léonard, Friedrich et Duchamp. Muni d’un important appareil critique, le catalogue comprend une liste des figures et des fiches techniques sur les œuvres d’art et les objets exposés. Courtes notices biographiques des artistes et des scientifiques. Circa 320 réf. bibl.",
