      "abstract": "This major exhibition catalogue draws attention to how aesthetic traditions (from Romanticism to the last avant-garde) relate to the conquests of explorers and technological discoveries by scientists. Fourteen authors elaborate upon the discovery of outer space, while discussing the following subjects: the relationship between artistic creation and natural science; the notion of America as the promised land; the polar regions; lunar photography; and imaginary cosmologies. Special attention is given to the ideas of three artist-scientists: Leonardo, Friedrich and Duchamp. Along with extensive critical information, the catalogue includes a list of images reproduced, as well as a list of works in the exhibition. Brief biographical notes on the artists and selected scientists. Circa 320 bibl. ref.",
