      "collation": "152 p. : 57 ill. (33 en coul.) ; 26 x 18 cm",
      "abstract": "Déry employs a theoretical approach in her analysis of Pellegrinuzzi’s photo-based installations, landscapes and portraits. Her essay focuses on the significance of details and fragments within the artist’s work. A wide range of topics are discussed, including: photography as medium, language, process and device; photography as means of reproduction, representation, imitation and poetry; the construction of photographic space; and the training of the gaze. List of works. Text in French and English. Bio-bibliography 10 p.",
