      "physical_copy": "TRUE",
      "resume": "Afin de montrer l’intérêt de Pellegrinuzzi pour tous les aspects de la pratique photographique et pour ses nombreux pouvoirs (de reproduction, de représentation, d’imitation, d’exposition et de poétisation), Déry propose une approche analytique et théorique de sa production. Répartissant celle-ci en tranches auxquelles elle attribue des enjeux thématiques – construction d’un espace photographique (installations du milieu des années 80), «chasseur d’images» (œuvres collectionneuses aux structures foliacées des années 90), «cibles et viseurs» (œuvres paysagistes à la technique sophistiquée), «instants» et «écorchés» (portraits basés sur les motifs de la main ou du visage) –, elle fait ressortir l’utilité des détails et des fragments dans l’exploration minutieuse que fait l’artiste du fonctionnement de l’image photographique, propre à l’éducation du regard. Fiches techniques sur les œuvres reproduites. Texte en français et en anglais. Biobibliographie 10 p.",
