      "abstract": "This publication was made to accompany Gervais’ retrospective at the Musée d’art de Joliette, which consisted of works produced between 1987-1999. The artist discusses his childhood experience, anthropological approach to art, interest in musical objects, and the issue of death. Boulanger’s descriptive analysis of the artist’s hybrid works (installations incorporating music and visual art) places emphasis on the lyrical aspect of Gervais’ “silent opera.” Texts in French and English. 39 bibl. ref.",
