      "resume": "Catalogue de la 1re rétrospective du travail de l’artiste montréalais réalisé entre 1987 et 1999, dont la mise en exposition, comme l’explique F. Gascon, souligne l’extrême singularité. Fidèle à son approche anthropologique de l’art, Gervais exprime son intérêt pour la musique et ses objets-supports au moyen d’un texte anecdotique sur sa petite enfance qui soutient une réflexion sur la mort, seule vraie question qui se pose à l’artiste selon lui. Dans ses descriptions d’installations, Boulanger met l’emphase sur le lyrisme de l’œuvre hybride (à la frontière de la musique et des arts visuels) et, paraphrasant le titre de l’exposition, qualifie d’«opéra silencieux» une démarche aux emprunts multiples qui vise la totalité. Textes en français et en anglais. 39 réf. bibl.",
