      "resume": "Catalogue accompagnant l’exposition consacrée aux œuvres photographiques de Collyer, réalisées sur une période de 30 ans. Grout analyse l’approche de l’artiste, qui se laisse guider par l’étonnement et remet en question le visible et notre vision, la mise en scène du quotidien, et le langage des signes urbains et publicitaires. Monk commente une série de photographies retouchées (1992-1998) qui, par l’effacement des éléments signalétiques et des messages, font ressortir l’espace social et les structures du paysage urbain de Toronto. Textes de Grout et de Monk en anglais et en français. Liste des œuvres. Liste sélective des expositions et bibliographie.",
