      "collation": "106 p. : circa 250 ill. (circa 150 col.) ; 23 x 30 cm",
      "abstract": "A survey of billboard art, this catalogue includes information on the billboards commissioned for the exhibition, those featured retrospectively, and hundreds of billboards that were not included. Senie gives precursors for the contemporary billboard, and lists the subject matter the latter broach, such as racism, feminism, environmentalism, and AIDS. Diggs discusses the problems encountered by billboard artists, and Heon writes about specific works in the exhibition, in particular those that combine expansive ideas with reductive images. Circa 98 bibl. ref.",
