      "book_title": "Lost Homelands",
      "datestamp": "2002-04-11",
      "uri": "http://e-artexte.ca/id/eprint/14425",
      "collation": "60 p. : 12 ill. (10 col.) ; 17 x 18 cm",
      "abstract": "This catalogue documents a touring exhibition comprised of photo-based works by four artists – M. Piña (Cuba), J. Puranen (Finland), E. Poitras and J. Yoon (Canada) – whose works present a critical look at the role of landscape in the construction of national identity and official historical narratives of homeland. Hurtig provides brief descriptive analyses of the artists’ works. The concept of landscape and issues of home, place and belonging are considered in relation to photography’s documentary function. Texts by D. Montes de Oca Moreda (on Piña), A. Young Man (on Poitras), E. Edwards (on Puranen) and S. McCabe (on Yoon) draw attention to a wide range of topics including: the relationship between place, memory and identity; issues of authorship, displacement and cultural marginalization; the colonization of the aboriginal peoples; and First Nations’ history and mythology. Artist’s statements by Piña, Puranen and Yoon. List of works. Biographical notes. 66 bibl. ref.",
