      "collation": "43 p. : 44 ill. (13 col.) ; 22 x 17 cm",
      "abstract": "This catalogue documents Buser’s installations created from architectural photographs taken during a six-month residency in Montreal in 1997, and exhibited at the Bern Kunsthalle and the Southern Alberta Art Gallery in 1998-1999. Kurzmeyer describes the artist’s process, characterized by decontextualization strategies and the production of fictive urban landscapes. Ireland focuses on the artist’s rejection of modernist idealization in architecture and on the quality of presence and fragility in her approach, allowing her to reveal the buildings’ social and political realities. Additional photographic installations on building façades and in the streets of Kracow, Montreal, Mexico City, Binningen and Basel are illustrated without commentary. Kurzmeyer’s text in English and German; Ireland’s text in English and French. List of works. Biographical notes. Selected bibliography l p.",
