      "abstract": "Catalogue published on the occasion of an exhibition presenting the artworks, objects and documents – related to architecture, urbanism and landscaping – acquired by the Canadian Centre for Architecture during its second decade of existence (1989-99). K. W. Forster suggests that a collection’s identity and vitality reside in its “rich depths” and “secret animus.” Lambert considers the collection in relation to the CCA’s research and exhibition activities. She suggests the collection is developed around notions of process and relationships, and favours a global approach to architecture (one that places it in its natural and social environment). Olsberg discusses acquisitions made by the CCA between 1989-99. Includes list of main donors.",
