      "resume": "Publié à l’occasion de l’exposition consacrée aux collections rassemblées par le Centre canadien d’architecture lors de sa deuxième décennie d’exploitation (1989-1999), ce catalogue rend compte des œuvres d’art, des objets et de la grande variété de documents – provenant des domaines de l’architecture, de l’urbanisme et de l’aménagement paysager – accumulés jusqu’ici. K. W. Forster explique que l’identité et la vitalité d’une collection résident dans ses «profondeurs foisonnantes», dans l’«esprit secret» qui lui est propre. Lambert souligne les traits caractéristiques de la collection fondée en 1979, indissociable des activités de recherche et des activités muséales du CCA: elle est notamment axée sur les notions de processus et de relation, par-delà les catégories traditionnelles, et favorise une approche globale de l’architecture dans son environnement naturel et social. Olsberg fait état de quelques-unes des acquisitions de cette dernière décennie, les plus considérables se situant dans la période de 1938 à nos jours, et présente leur contribution spécifique à l’étude des idées et des mouvements. Liste des principaux donateurs.",
