      "abstract": "Liss notes that the title of the curator’s essay, “Eventlessness, Eventuality: Odd Moments in a Documentary Mode” aptly describes this two-part exhibition. Langford claims the photography of Billingham and Fox resists the usual satisfactions of social documentary. She also comments on how the “Affinities” part of the show (featuring the work of eight photographers) relates to the work of Billingham and Fox. Text in English and French. List of works. Biographical notes. 11 bibl. ref.",
