      "collation": "48 p. : 15 ill. ; 26 x 22 cm",
      "abstract": "This publication documents the second presentation of an event promoting creative activity in the region of Montérégie (the title’s reference to giving “shape to a thing” foregrounds the theme of creativity). It includes photographic reproductions of works by 15 artists (paintings, prints and photographs), which are presented alongside poems by 15 authors. In their brief curatorial text Lemay and Proulx suggest that the artists and writers capitalize on the similar sensorial experiences, as a means of addressing the following subjects: the body, the indistinct, accompaniment, the invisible, vibration and uprooting. Poems in French only. Brief biographical notes on artists and authors.",
