      "physical_copy": "TRUE",
      "resume": "Cette deuxième édition d’un événement montérégien promulguant la création régionale réunit autour du thème de l’acte de création lui-même (c’est le sens de l’expression «donner forme») les poèmes de 15 auteurs, jumelés aux œuvres peintes, gravées ou photographiques de 15 artistes. Bien que l’expression écrite ait fait surgir les expressions imagées, on fait valoir que toutes, capitalisant sur les mêmes expériences sensorielles, travaillent conjointement à stimuler l’imagination à travers des notions telles que le corps, l’indistinct, l’accompagnement, l’invisible, la vibration et le déracinement. Préfaces en français et en anglais. Courtes notices biographiques des artistes et des auteurs.",
