      "resume": "Présentation des œuvres de la décennie 90 de l’artiste de Vancouver, considéré ici en tant que représentant d’une nouvelle photographie. Identifiant le projet artistique de Wall à une réconciliation de la tradition de la grande peinture avec les ressorts du spectacle manière contemporaine, Lussier analyse spécifiquement le dispositif et la méthode de travail qui rapprochent le photographe du peintre comme du metteur en scène. Gingras, intéressée par le phénomène du déplacement multiple dans l’œuvre, suit ses effets sur le statut de l’image ainsi que sur l’expérience du regard. Texte en français et en anglais. Liste des œuvres. Biobibliographie 7 p.",
