      "resume": "Cette publication commémore les 25 ans d’existence du centre d’artistes québécois voué à la promotion de l’estampe originale par un compte rendu détaillé des célébrations ayant marqué l’année 1997-1998. Sanfaçon résume le parcours gravé de Simonin durant les années 90, qui fait l’objet d’une exposition hommage; elle analyse les œuvres en duo de 36 artistes membres anciens et actuels (réunis dans une exposition), qu’elle regroupe sur la base d’une parenté formelle ou d’un enjeu commun. Malenfant propose une analyse de l’histoire artistique du centre, en subsumant sous le terme des «identités» différents concepts tels que le quotidien, le ludisme, l’abstraction, l’hybridité, le baroque, l’intimisme et l’interculturalisme. À partir des archives du centre, D. Pelletier effectue une compilation des expositions en solo, en duo ou en collectif présentées depuis sa fondation – incluant photos, listes d’artistes invités, d’événements, de publications, et de membres actifs. Notices biographiques des auteures. 2 réf. bibl.",
