      "resume": "Richmond examine la série photographique de Wallace intitulée « Masculin / Féminin », qui juxtapose des images d’hommes et de femmes tirées de classiques du cinéma des années 1950 et 1960. La conservatrice trace un parallèle entre cette œuvre et le travail antérieur de l’artiste, puis en fait ressortir le thème principal : la tension et le jeu de l’anxiété et de l’autonomie générés par l’espace différentiel entre les images. Texte en français et en anglais. 7 réf. bibl.",
      "event_statement": unescape('Dates%20d%27exposition%3a%209%20sept%2e%20%2d%2011%20oct%2e%201997%2c%20Galerie%20d%27art%20Leonard%20%26%20Bina%20Ellen%20%28Montr%e9al%29%2e'),
