      "resume": "Plusieurs auteurs d’horizons culturels divers (astrophysique, musique, critique d’art, muséologie) abordent le thème de la créativité de la nature à travers les œuvres de trois artistes qui l’ont prise pour modèle. Ainsi, la vingtaine d’œuvres textiles réalisées par Simard-Laflamme et la trentaine de photographies de paysages québécois de Mia et Klaus sont analysées dans leurs composantes formelles et techniques. On y aborde aussi la noton de correspondance, les relations au monde et le cosmos avec ses cycles et ses transformations. Comprend quelques propos d’artistes et un texte de H. Reeves en réimpression. Notices biographiques. 3 réf. bibl.",
