      "resume": "Suivant une logique subjective dans sa présentation d’un art difficile à définir, Rousseau regroupe en trois zones – correspondant à trois types de créations et à des lieux distincts de l’exposition – les œuvres de 22 artistes québécois qui relèvent de l’«art des patenteux» aussi bien que de l’«art hors les normes». L’emphase est mise sur l’engagement des artistes de même que sur le concept d’indisciplinarité (J. Simard) et sur les questions d’éthique (P. Galipeau). 7 réf. bibl.",
