      "resume": "Pochette contenant 15 feuillets numérotés qui présentent les expositions et les événements de la saison 1998-1999 chez Skol. Dans une brève introduction, Roy souligne que s’il n’existe pas d’esthétique « skolienne », la grande diversité des œuvres (et celle des textes qui les accompagnent) est l’expression de la perméabilité des genres et des ramifications des activités au delà même du monde de l’art. Sommaire et calendrier des expositions. Textes de Miller et de Wawzonek en français et en anglais, tous les autres en français. Notices biographiques des artistes et des collaborateurs. 13 réf. bibl.",
