      "collation": "64 p. : 14 ill. (12 en coul.) ; 25 x 28 cm",
      "abstract": "Three authors analyze the work of this Montreal-based artist, in particular a video installation entitiled “Paramour.” Pontbriand examines Cadieux’s use of the image in movement and her elaboration of a gestural language, while Louppe outlines the problematics of the body in terms of the notion of a “between body.” Watson, in search of the artist’s intent, traces the genesis of the exhibition; he also examines the Duras text used by Cadieux and her creation of a perspective which is both intimate and distant. Some of the concepts addressed in the discussions include: identity, the double, relationships between women and men, caesura, the irreparable. Texts in French and English. Bio-bibliography 3 p.",
