      "eprint_status": "archive",
      "physical_copy": "TRUE",
      "resume": "Trois auteurs analysent l’œuvre de l’artiste montréalaise et en particulier une installation vidéo intitulée «Paramour». Pontbriand s’intéresse à la pratique de l’image en mouvement et au développement d’un langage gestuel chez Cadieux, et Louppe cerne la problématique du corps à travers la notion d’«entre-corps». Watson, en quête de l’intention de l’artiste, retrace la genèse du projet d’exposition; il interroge le texte de Duras utilisé par Cadieux et conclut sur une question de point de vue: le proche et le lointain combinés. Dans les descriptions des œuvres affleurent, entre autres, les concepts d’identité, de double, de césure et d’irréparable, et les relations homme-femme. Textes en français et en anglais. Biobibliographie 3 p.",
