      "resume": "Publication abondamment illustrée accompagnant une exposition rétrospective des œuvres photographiques de Gagnon. Soulignant l’aspect métaphysique de l’œuvre, Cousineau démarque la pratique de Gagnon des orthodoxies nord-américaines (formalisme, documentaire social) et en approfondit les significations personnelles et les thèmes : fenêtre, emprisonnement de la nature, entassement d’objets. Dans un entretien avec Asselin, l’artiste offre une vision intimiste, centrée sur la conception de la photographie en tant que regard porté sur le monde, mais dans laquelle trouvent place le caractère surréaliste et les coïncidences entre les choses. Liste des œuvres exposées ; notice biographique. Bibliographie, 4 p.",
