      "abstract": "A special edition of Parachute magazine to coincide with the presentation of the narrative images of American photographer Michals at the Montreal Museum of Fine Arts. In an interview with the artist, Livingstone explores the work’s relationship to literature and the play between text and image, later considering the three main bodies of work in the exhibition. Coleman discusses Michals’ philosophical writings which are incorporated into his most recent series entitled “Questions without Answers,” while V. Lavoie addresses the presence of the invisible (referred to as a “poetics of otherness”) in Michals’ work of the 1960s and 1970s. List of illustrations with French translations of textual elements of the photographs. Texts in French and English (texts by Coleman and Lavoie in the original language with a summary in translation). Biographical notes. Filmo-bibliography 1 p.",
