      "resume": "Numéro hors-série de la revue Parachute coïncidant avec une présentation des images narratives du photographe américain au Musée des beaux-arts de Montréal. Dans un entretien avec l’artiste, Livingstone explore le rapport de l’œuvre à la littérature et le jeu entre le texte et l’image, pour ensuite examiner les trois groupes d’œuvres qui forment l’essentiel de l’exposition. Pour sa part, Coleman traite des écrits philosophiques de Michals, intégrés à sa plus récente série intitulée «Questions without Answers», tandis que V. Lavoie se penche sur les «manifestations de l’invisible» dans l’œuvre des années 60 à 70 pour montrer comment elles expriment une «poétique de l’altérité». Liste des illustrations avec traduction française des textes incorporés aux photographies. Textes en français et en anglais de Coleman et de Lavoie dans la langue originale avec résumé en traduction. Notices biographiques des l’artiste et des auteurs. Filmo-bibliographie 1 p.",
