      "resume": "Catalogue qui retrace l’activité de Perron comme portraitiste au sein du groupe automatiste, dont l’apport à la mémoire collective se trouve souligné par J. Porter et N. de Blois. La reproduction pleine page de 96 portraits en solo ou en duo des cosignataires de Refus global (l’exposition en souligne le 50e anniversaire de parution) ou de portraits de groupe pour les événements marquants, presque tous datés de 1947 et 1948, traduit l’effervescence de ce milieu. En entretien avec de Blois, l’artiste aborde le choix du médium photo et les aspects techniques de sa pratique, ses rencontres et ses liens avec les artistes, ainsi que le rôle de témoin dévolu à la photographie. Brève notice biographique. 5 réf. bibl.",
