      "abstract": "An unconventional exhibition catalogue - consisting of 13 pamphlets in a box similar in style to those used for photographic paper - published on the occasion of a major photography festival in Winnipeg which included solo/group exhibitions, performances, public art installations, a symposium, ect. The catalogue includes texts by 13 authors who address diverse themes (travel photography, the Quebec documentary tradition, the city, gay and lesbian identity, chilhood and memory, racial stereotyping and surveillance) in response to works by 25 artists. Biographical notes on authors. Circa 63 bibl. ref.",
