      "collation": "135 p. : circa 100 ill. coul. ; 17 x 24 cm",
      "abstract": "Surveying Orta’s recent work, including his work with light and projections, installation, and perfomance, Glusberg’s essay examines Orta’s methods, symbols, and his social and historical concerns, especially in relation to the the artist’s preoccupation with an “aesthetics of ethics.” A text by Orta refers to some of his specific works while presenting his perception of the social function of art. Both texts discuss “Networks of Dust,” Orta’s project for the 46th Venice Biennale. Brief descriptions of other recent projects are also included. Texts in French and English. Orta’s text and two descriptions also in Spanish. Biographical notes.",
