      "resume": "Proposant un survol du travail récent d’Orta (œuvres lumineuses et projections, installations, performances), Glusberg examine les méthodes et les symboles utilisés par l’artiste, de même que ses préoccupations sociales et historiques, notamment en ce qui a trait à une « esthétique de l’éthique ». Orta élabore sur certaines de ses œuvres et sur sa perception de la fonction sociale de l’art. Glusberg et Orta abordent aussi le projet « Réseaux poussière », réalisé par l’artiste dans le cadre de la 46e Biennale de Venise. Inclut de brèves descriptions d’autres projets récents. Textes en français et en anglais ; texte d’Orta et deux descriptions aussi en espagnol. Notice biographique.",
