      "resume": "Publié parallèlement à une exposition qui présentait le travail de 14 artistes, cet ouvrage comprend huit essais à portée historique et théorique, consacrés à la projection — décrite ici comme « phénomène lumineux du transport d’une image d’un lieu à un autre ». Les auteurs s’intéressent notamment au cinéma expérimental, à l’« écran rétinien », à la métaphore poétique comme projection à la Renaissance, aux expériences des avant-gardes dans les années 1920, à la couleur, et à la photographie comme produit projectif. Inclut une section « catalogue » où Païni analyse les œuvres de l’exposition. Liste des œuvres, notices biographiques des artistes et bibliographie. Circa 150 réf. bibl.",
