      "abstract": "This exhibition catalogue, edited by the curator, De Zheger, surveys the contribution of women to 20th century art through the work of 37 artists, splitting the contents into four thematic sections, each of which are divided into three periods: the 1930s-40s, the 1960s-70s, and the 1990s. The four sections address, respectively, feminine plurality and difference, the poetics of alterity, the interweaving of language and space, and finally, materiality and embodiment. Index, 4 p. List of works. Biographical notes. Bibliography 8 p. Circa 660 bibl. ref.",
